USE covid

CREATE TABLE IF NOT EXISTS data (
    `country` VARCHAR(24) CHARACTER SET utf8,
    `date` DATETIME,
    `total_vaccinations` NUMERIC(9, 1),
    `people_vaccinated` NUMERIC(9, 1),
    `people_fully_vaccinated` NUMERIC(9, 1),
    `daily_vaccinations_raw` NUMERIC(8, 1),
    `daily_vaccinations` NUMERIC(8, 1),
    `total_vaccinations_per_hundred` NUMERIC(4, 2),
    `people_vaccinated_per_hundred` NUMERIC(4, 2),
    `people_fully_vaccinated_per_hundred` NUMERIC(4, 2),
    `daily_vaccinations_per_million` NUMERIC(6, 1),
    `vaccines` VARCHAR(82) CHARACTER SET utf8
);
